let user = require("../../registration/registration");

const RegistrationWithCheckBox = () => {
  return (
    <div>
      <div>
        {Object.keys(user?.inputWithRadioButton).map((value,index) => {
          return (
            <div>
              <lable>{user?.inputWithRadioButton?.[value][index]}</lable>
              <input
                type= "radio"
              />
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default RegistrationWithCheckBox;
